import React from 'react';

const FAQSection = () => {
  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-[#FFFF] p-8">
      {/* Родительский контейнер с фиксированными размерами */}
      <div className="w-[200px] h-[250px]">
        {/* Основной контейнер */}
        <div className="max-w-6xl w-full flex flex-col md:flex-row items-center gap-8">
          {/* Левая часть: Фоновая картинка */}
          <div className="hidden md:block flex-1 relative" style={{ marginTop: '0', marginLeft: '0' }}>
            <img
              src="/images/img20.png" // Замените на путь к вашей фоновой картинке
              alt="Background"
              className="w-full h-auto" // Фоновая картинка с прозрачностью
            />
            {/* Центральная часть: Основная картинка */}
            <img
              src="/images/img10.png" // Замените на путь к вашей основной картинке
              alt="Placeholder"
              className="absolute w-2/3 h-auto rounded-lg shadow-lg"
              style={{ top: '50px', left: '50px' }} // Координаты для позиционирования
            />
          </div>

          {/* Правая часть: Текст и кнопки */}
          <div className="flex-1 flex flex-col space-y-6">
            {/* Заголовок */}
            <div className="text-left">
              <h1 className="text-3xl font-bold text-gray-800 mb-4">Frequently Asked Questions</h1>
              <h2 className="text-xl text-gray-600">You’ve Any Questions</h2>
            </div>

            {/* Две кнопки */}
            <div className="space-y-4">
              {/* Первая кнопка */}
              <button
                className="w-full inline-flex p-4 pl-6 justify-between items-center gap-4 rounded-lg bg-[#F8F7F0] hover:bg-[#E0DFD8] transition duration-300"
                onClick={() => alert('Button 1 clicked!')}
              >
                <h3 className="text-lg font-bold text-gray-800">World’s hottest destinations for vegans</h3>
                <div
                  style={{
                    display: 'flex',
                    justifyContent: 'center',
                    alignItems: 'center',
                    borderRadius: '10px',
                    background: '#C5CE38',
                    width: '60px',
                    height: '60px',
                  }}
                >
                  {/* Иконка или текст внутри квадрата */}
                </div>
              </button>

              {/* Вторая кнопка */}
              <button
                className="w-full inline-flex p-4 pl-6 justify-between items-center gap-4 rounded-lg bg-[#F8F7F0] hover:bg-[#E0DFD8] transition duration-300"
                onClick={() => alert('Button 2 clicked!')}
              >
                <h3 className="text-lg font-bold text-gray-800">Let’s grow naturally and live naturally</h3>
                <div
                  style={{
                    display: 'flex',
                    justifyContent: 'center',
                    alignItems: 'center',
                    borderRadius: '10px',
                    background: '#C5CE38',
                    width: '60px',
                    height: '60px',
                  }}
                >
                  {/* Иконка или текст внутри квадрата */}
                </div>
              </button>
            </div>

            {/* Текст между второй и третьей кнопкой */}
            <div className="text-gray-600 text-sm">
              <p>
                Suspendisse finibus urna mauris, vitae consequat quam vel. Vestibulum leo
                ligula, molestie ullamcorper vulputate vitae sodales commodo nisl. Nulla
                facilisi. Pellentesque est metus many of some form.
              </p>
            </div>

            {/* Третья кнопка */}
            <button
              className="w-full inline-flex p-4 pl-6 justify-between items-center gap-4 rounded-lg bg-[#F8F7F0] hover:bg-[#E0DFD8] transition duration-300"
              onClick={() => alert('Button 3 clicked!')}
            >
              <h3 className="text-lg font-bold text-gray-800">Best vegetables for your healthy hair</h3>
              <div
                style={{
                  display: 'flex',
                  justifyContent: 'center',
                  alignItems: 'center',
                  borderRadius: '10px',
                  background: '#C5CE38',
                  width: '60px',
                  height: '60px',
                }}
              >
                {/* Иконка или текст внутри квадрата */}
              </div>
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default FAQSection;
